import React, {useState} from 'react'
import './styles/reset.css'
import './styles/todo-item.css'
import TodoGroup from "./.components/todoGroup";


function App() {

    const [todosData, dataHandler] = useState([
        {
            todo: "todoGroup1",
            data:[
                {
                    id: 1,
                    title: "text Titel",
                    text: "text lorem bla bla"
                },
                {
                    id: 2,
                    title: "Title",
                    text: "lorem and nothing more"
                },
            ]
        },
        {
            todo: "Group2",
            data:[
                {
                    id: 1,
                    title: "tItle text",
                    text: " bla bla text lorem"
                },
                {
                    id: 2,
                    title: "nothing",
                    text: "nothing nothing nothing"
                },
            ]
        },
    ] )

    return (
        <div className="App">
            {
                todosData.map( todoGroup =>
                    <TodoGroup title={todoGroup} key={todoGroup.id}/>
                )
            }

        </div>
    )
}

export default App
